  [],\n\t\"revision_timestamp\": \"2016-07-27T22:56:12.123902\",\n\t\"name\": \"kirwin-national-wildlife-refuge-annual-narrative-report-calendar-year-1984\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Kirwin
  National Wildlife Refuge outlines Refuge accomplishments during the 1984 calendar
  year. The report begins with a summary of the year's highlights and weather conditions.
  The report includes a planning section which discusses management planning. Refuge
  administration is outlined; information about personnel, funding, and safety is
  given. Habitat management is also covered; subjects include wetlands, forests, croplands,
  grasslands, haying, fire management, pest control, and wilderness and special areas.
  The wildlife section of the report discusses endangered and threatened species,
  waterfowl, marsh birds and waterbirds, shorebirds, raptors, game mammals, other
  resident wildlife, fisheries resources, animal control, and marking and bird banding.
  The public uses of the Refuge described in this report include interpretive programs,
  hunting, fishing, wildlife observation, other wildlife oriented recreation, camping,
  picnicking, off-road vehicling, other non-wildlife oriented recreation, and law
  enforcement. The equipment and facilities section of the report provides information
  about major maintenance, equipment utilization and replacement, communications systems,
  and energy conservation. Cooperative programs and items of interest are provided
  at the end.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
